// @mui material components
import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";
// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import DataTable from "examples/Tables/DataTable";
import ProductCell from "layouts/ecommerce/products/product-page/components/ProductCell";
// Images
const blackChair =
    "https://raw.githubusercontent.com/creativetimofficial/public-assets/master/soft-ui-design-system/assets/img/ecommerce/black-chair.jpg";



function Opportunity() {
    const columns =
    {
        columns: [
            { Header: "Investor Name", accessor: "product" },
            { Header: "BSE UCC", accessor: "bse" },
            { Header: "PAN No", accessor: "pan", align: "center" },
            { Header: "Total Amount", accessor: "amount", align: "center" },
        ],

        rows: [
            {
                product: <ProductCell image={blackChair} name="AGARWAL BUILDCON" />,
                bse: "A3832",
                pan: "ABGFA5273N",
                amount: "12,499",
            },
        ],


    }

    return (
        <DashboardLayout>
            <DashboardNavbar />
            <SuiBox my={3}>

                <SuiBox mb={3}>
                    <Grid container spacing={3} alignItems="center">
                        <Grid item xs={12} lg={12}>

                            <SuiBox
                                backgroundColor="dark"
                                borderRadius="lg"
                                boxShadow="lg"
                                p={2}
                                backgroundGradient
                                lineHeight={1}
                            >
                                <SuiTypography variant="h6" fontWeight="medium" textColor="white">
                                    ELSS Lock-in free Report
                                </SuiTypography>
                                <br />
                                <SuiBox mb={3}>
                                    <SuiTypography variant="button" fontWeight="regular" textColor="white">
                                        This report shows the units invested in ELSS funds which are free from Lock-in period of 3 years, for each user and can now be switched into other suitable fund choices.
                                    </SuiTypography>
                                </SuiBox>
                            </SuiBox>
                        </Grid>
                    </Grid>
                </SuiBox>
            </SuiBox>

            <SuiBox>
                <Card id="change-password">
                    <SuiTypography variant="h4" fontWeight="medium" style={{ marginLeft: "20px", margin: "20px" }}>
                        Internal Holdings
                    </SuiTypography>
                    <DataTable table={columns} />
                </Card>
            </SuiBox>

            <SuiBox my={3}>
                <Card>
                    <SuiTypography variant="h4" fontWeight="medium" style={{ marginLeft: "20px", margin: "20px" }}>
                        External  Holdings
                    </SuiTypography>
                    <DataTable table={columns} />
                </Card>
            </SuiBox>
            <Footer />
        </DashboardLayout>
    );
}

export default Opportunity;
